syntax = "proto3";
package test;

import "google/protobuf/descriptor.proto";

option java_package = "com.ling5821.aiproto.proto";
option java_outer_classname = "TestDescriptorProto";

message MessageOptions {
  repeated string messageTypeId = 1;
}

extend google.protobuf.MessageOptions {
  optional MessageOptions message_options = 1124;
}
